      <Content>
        <h1>Busca de CEP Api Correios</h1>
        <form action="">
          <input type="text" name="cep" placeholder="Digite seu cep" />
          <button type="submit">Pesquisar</button>
        </form>

        <div>
          <label htmlFor="">Bairro</label>
          <input type="text" />
        </div>
      </Content>
    </Container>
  );
};

export default Correios;
